import React from 'react'
import Navstyle from './Navbar';

export default function Navbar() {
  return (
    <nav>
        <ul className="list">
            <li className="item" centered>Home</li>
            <li className="item" centered>Tienda</li>
            <li className="item" centered>Contacto</li>
        </ul>
        <button className="btn" centered>BTN</button>
    </nav>
  )
}
